import React from 'react';

const Header = () => (
  <header style={{ padding: '0px', backgroundColor: '#fff', }}>
    
      <img src="/apple/logo.png" alt="apple-logo" width="60" height="60"/>
      <h4>WATCH</h4>
  </header>
);

export default Header;
